Spalio 12-ąją jis rezultatyviai asistavo Diniarui Bilialetdinovui pergalingose rungtynėse su „Žalgiriu“, po to po du kartus perdavimais „pavaišino“ komandos draugus dvikovose su „Kauno Žalgiriu“ ir „Jonava“, o tokie rezultatai kaip reikiant futbolininką kilstelėjo ir geriausių lygos asistentų sąraše. Pagal šią statistiką ryškūs lyderiai yra po dešimt kartų komandos draugams asistavę Oscaras (iš „Trakų“) ir Andro Švrljuga (iš „Sūduvos“). M. Šiška kartu su Vytautu Lukša, Maksimu Marusičiumi, Vaidu Slavicku ir Ovidijumi Verbicku dalinasi trečiąją vietą. Maža to, pagal „Instat“ duomenis, M.Šiška spalio mėnesį yra vienas geriausių visos A lygos žaidėjų. „Manyčiau, kad tai labiausiai susiję su tuo, kad pastaruoju metu žaidžiu tose pozicijose, kurios labiau skirtos atakai. Be to, prie komandos prisijungus Diniarui Bilialetdinovui, rezultatyvų perdavimą atlikti kur kas paprasčiau. Jis puikiai supranta žaidimą, laiku atsidengia, o tai labai palengvina kitų žaidėjų darbą. Kitų priežasčių nežinau“, – pokalbį su oficialia klubo svetaine pradėjo M. Šiška. – Michailo, „Trakuose“ esate pusantrų metų. Kaip įvardintumėte pasikeitimus per tą laiką? – Kadangi keitėsi treneriai, keitėsi žaidėjai, tai natūralu, kad keitėsi ir pats žaidimas. Kita vertus, bendrai vertinant sakyčiau, kad geru lygiu žaidėme ir tada, ir dabar. Manau, kad tai svarbiausia. Rūbinėje niekas nepasikeitė – pas mus geras kolektyvas buvo visąlaik. – Turnyro lentelėje „Trakai“ šiuo metu yra trečioje vietoje. Neapmaudu, kad sezono pradžioje išbarstėte tiek daug taškų? – O kokia prasmė gailėtis? Reikia eiti į aikštę ir laimėti tas ketverias rungtynes, kurias dar turime sužaisti. Galutiniai taškai bus sudėti tik tada. – Kaip manote, kieno šansai didesni prieš rytojaus rungtynes su „Žalgiriu“? – Rytoj ir pamatysime. (function(d, s, i, r) {
